import React from 'react';


const INPUT_LIST = [
    {
      id: 1,
      name: '이름',
      value: 'nameValue',
    },
    {
      id: 2,
      name: '이메일',
      value: 'emailValue',
    },
    {
      id: 3,
      name: '연락처',
      value: 'phoneValue',
    },
  ];
  
  export default INPUT_LIST;
